import Card from './../components/Card';
const Main = (props) => {
  return (
    <>
      <div className="main-bg"></div>
      <button onClick={() => {
        const newShoes = [...props.shoes];
        newShoes.sort((a, b) =>
          a.title < b.title ? -1 : 1
        );
        props.setShoes(newShoes);
      }}>낮은 가격</button>
      <div className="container">
        <div className="row">
          {props.shoes.map((item, i) => <Card shoes={item} i={i+1} key={item.id}/>)}
        </div>
      </div>
    </>
  )
}
export default Main;
